import Layout from '../components/Layout'
import Toggle from '../components/Toggle'
import { useState } from 'react';

export default function Index({ newGame }) {

  const [officialWords, setOfficialWords] = useState(true);

  return (
    <Layout>
      <main className="self-center">
        <Toggle text={'Use official words'} onToggle={() => setOfficialWords(!officialWords)} checked={officialWords} />
        <button className="btn btn-blue" onClick={newGame}>
          New Game
        </button>
        <div className="self-center">HomePage What</div>
        {/* {boardMap && <span className="author">- {boardMap}</span>} */}

        <style jsx global>{`
            @font-face {
              font-family: 'Open Sans', sans-serif;
              src: url('https://fonts.googleapis.com/css?family=Open+Sans&display=swap');
              font-weight: bold;
              font-style: normal;
              font-display: swap;
            }`

        }
        </style>
      </main>
    </Layout>
  );
}
